K75xjMx0YJFuWXEKBiJpzqewlq_-TgnftONOOwHQki2ElE5wJPkEhD33PpMhDXuYNGWjdlJG1TLGhSwz82W-5tSdNyMhhK3_rP4I16QGQ";s:7:"reviews";a:5:{i:0;a:8:{s:11:"author_name";s:13:"Jui Hong Teoh";s:10:"author_url";s:65:"https://www.google.com/maps/contrib/104902586026265303304/reviews";s:8:"language";s:2:"en";s:17:"profile_photo_url";s:122:"https://lh6.googleusercontent.com/-srlxLnE6NFc/AAAAAAAAAAI/AAAAAAAAfLg/1Z2HVu1pb6k/s128-c0x00000000-cc-rp-mo-ba7/photo.jpg";s:6:"rating";i:4;s:25:"relative_time_description";s:10:"a week ago";s:4:"text";s:1109:"The North Terrace marks the top border of the Adelaide CBD, the main road before the river. On the North Terrace is situated many Adelaide landmarks including the Parliament House, The Royal Adelaide Hospital, Adelaide Casino, The State Library of South Australia and the University of Adelaide. I was only in senior school at the time, but somehow found myself spending a lot of time here, particularly wandering the grounds of the University of Adelaide. One of my cousins was studying here at the time and there are times when I would follow her here. The buildings are beautiful, the libraries amazing and they have this amazing university bookstore that I love spending time in. Yeah, I was a weird nerdy kid. But it was my way of escape.\nThe University itself is the 3rd oldest in Australia and at one point, was one of my major choices for where I would have ended up studying. Too bad Adelaide felt too slow for me but I do love the campus here. I used to spend time in the Barr Smith Library, just watching other university students go about campus life, counting down towards my turn at university.";s:4:"time";i:1521330631;}i:1;a:8:{s:11:"author_name";s:11:"June Howard";s:10:"author_url";s:65:"https://www.google.com/maps/contrib/113211500845731556973/reviews";s:8:"language";s:2:"en";s:17:"profile_photo_url";s:118:"https://lh4.googleusercontent.com/-MTAxKdgVxDI/AAAAAAAAAAI/AAAAAAAAAAc/mS0cB74Q6fY/s128-c0x00000000-cc-rp-mo/photo.jpg";s:6:"rating";i:5;s:25:"relative_time_description";s:12:"3 months ago";s:4:"text";s:379:"Best place to go to university in Australia in my opinion, for undergrad at least. The campus is just beautiful, it manages to blend the feel of the timeless historic buildings together with the modern facilities and schools. The university''s diverse set of students is full of friendly and passionate individuals wanting to learn. Adelaide gets nothing short of 5 stars from me!";s:4:"time";i:1512152598;}i:2;a:8:{s:11:"author_name";s:9:"Raj Singh";s:10:"author_url";s:65:"https://www.google.com/maps/contrib/105669051778945580654/reviews";s:8:"language";s:2:"en";s:17:"profile_photo_url";s:145:"https://lh6.googleusercontent.com/-GwBIJnqS3FQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWATXLVoU60cXom9uX5GVqQFrDspYw/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg";s:6:"rating";i:5;s:25:"relative_time_description";s:12:"2 months ago";s:4:"text";s:252:"A great university with a proud track record of having produced outstanding researchers and scholars. A location within the city centre makes it easily accessible.The campus in the city centre is within easy walking distance to buses, trams and trains.";s:4:"time";i:1516146061;}i:3;a:8:{s:11:"author_name";s:11:"Simon Atkin";s:10:"author_url";s:65:"https://www.google.com/maps/contrib/115920688727073141755/reviews";s:8:"language";s:2:"en";s:17:"profile_photo_url";s:118:"https://lh4.googleusercontent.com/-Xx1YgiMZ49k/AAAAAAAAAAI/AAAAAAAAAKY/cN86gNHQF2c/s128-c0x00000000-cc-rp-mo/photo.jpg";s:6:"rating";i:5;s:25:"relative_time_description";s:12:"3 months ago";s:4:"text";s:369:"I loved my time at the venerable University of Adelaide and would recommend it. Its faculties are very esteemed; the programmes offered are intellectually-stimulating and rigorous. The campus is state-of-the-art and everything is a walking distance from it as it is centrally located. There is a great feeling of intellect and tradition in the atmosphere of the school.";s:4:"time";i:1512153688;}i:4;a:8:{s:11:"author_name";s:7:"olo lol";s:10:"author_url";s:65:"https://www.google.com/maps/contrib/111118422192973500713/reviews";s:8:"language";s:2:"en";s:17:"profile_photo_url";s:141:"https://lh3.googleusercontent.com/-siTgmEc52vA/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWC9n0zM2x-hvm0gQ_3-105yDp9-Nw/s128-c0x00000000-cc-rp-mo/photo.jpg";s:6:"rating";i:1;s:25:"relative_time_description";s:12:"2 months ago";s:4:"text";s:235:"Full of racist group and individuals. Not so qualified staff who can’t even speak English properly. Not worth the money and time. Expensive tuition yet not so recognisable degree internationally. In one word.... regret to study there";s:4:"time";i:1515814400;}}s:5:"scope";s:6:"GOOGLE";s:5:"types";a:3:{i:0;s:10:"university";i:1;s:17:"point_of_interest";i:2;s:13:"establishment";}s:3:"url";s:49:"https://maps.google.com/?cid=13001582016909206207";s:10:"utc_offset";i:630;s:8:"vicinity";s:8:"Adelaide";s:7:"website";s:27:"http://www.adelaide.edu.au/";}s:6:"status";s:2:"OK";}}', '', '', '', 'Australia', 'South Australia', 'Adelaide City Council', '', '', '', 'Adelaide', '', '', '5005', '', ''),
